import './App.css';
import Home from './pages/Home';
import {  Router, Route, Routes } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';


import Leftbar from './component/Leftbar';
function App() {
  return (
    <div className="App">




      <Leftbar/>

    <Router>
      <Routes>
        <Route path="/" element={<Home />} />

      </Routes>
    </Router>

    </div>


  );
}

export default App;
